&quot; Barnardo's energetic desire to spread the word once took him to a large, fortressy local pub called the Edinburgh Castle. He strode into the smoke-filled, gin-soaked room and started offering Bibles for threepence, or New Testaments for a penny. There weren't many takers. In his memoir, Night and Day, he recalled the pointed lack of enthusiasm: &quot;I presently found myself on the ground with the flat part of the table pressing on me. Several of the biggest lads leaped inside it, dancing a `devil's tattoo', to my great discomfort.&quot;
Still, he persisted. Virtue might have its spoilsport aspects, but it can be robust. He raised funds, bought the Edinburgh Castle and turned it into a Christian mission. It became the headquarters of a charitable giant. By the time he died, in 1905, Dr Barnardo's schools had trained over 50,000 children. His orphanages, those famous &quot;homes&quot;, had housed 12,000 more. &quot;

