This postcard picture was taken between 1901 and 1910. The church was re-built in the form shown c.1890 and the stamp is from the reign of Edward VII 1901-1910. The postcard has been damaged at some point. It is franked Edinburgh 2am Jan 22 1907. It was sent to Mrs Geo. Airth, Gas Works House, Dundalk, Ireland.

The message reads:

&quot;Just sending off a few P.C.s before leaving. Hope you are well. Best wishes from J G M.&quot;

The Scottish National Gallery and the Royal Scottish Academy are constructed on the Mound. This postcard was posted in Letterkenney, County Donegal, Ireland at 5.30pm Sept 25. The year is obliterated. (However it bears an Edward VII stamp - so it must have been posted between 1901 and 1910).

The message to Miss L Woods of Sooish, Newtoncunningham reads:

&quot;Mrs Gregg was in town lately and she says she is afraid they will not have time to go to see you now. Minnie &amp; Bob go away on Saturday and I suppose she thinks the time all too short. From M W Corry.&quot;
